// src/components/Home.js
import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="home">
      <h1>Welcome to Bus Ticket Booking</h1>
      <Link to="/buses">
        <button>View Available Buses</button>
      </Link>
    </div>
  );
};

export default Home;
